import React from "react"
import productData from "../asset/data"

const Product = () => {
 
     
    

    return(
        <div>

            {
                productData.length === 0 ?
                (<div> No data found </div>):
                (productData.map((product) => (
                    <div key={product.id}>
                        
                        <img src="${product.image1}"/>
                        
                        <p>{product.productName}</p>

                    </div>
                )))
            }
     

        </div>
    )
}

export default Product;
